import React, { useState, useEffect } from "react";
import axios from "axios";
import 'slds.css'; // Ensure to import SLDS styles

const Tasks = () => {
  const [tasks, setTasks] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    fetchTasks();
  }, []);

  const fetchTasks = async () => {
    try {
      const response = await axios.get("http://localhost:8000/tasks/all");
      setTasks(response.data);
    } catch (error) {
      console.error("Error fetching data: ", error);
    }
  };

  const handleSearchChange = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleRefresh = () => {
    fetchTasks();
  };

  return (
    <div className="slds-container slds-m-top_medium">
      <div className="slds-grid slds-grid_vertical-align-center">
        <div className="slds-col slds-size_1-of-1 slds-p-top_large slds-p-bottom_small">
          <div className="slds-grid">
            <div className="slds-col slds-size_1-of-2">
              <h2 className="slds-text-heading_medium">Tasks</h2>
              <p className="slds-text-body_regular">All Tasks</p>
            </div>
            <div className="slds-col slds-size_1-of-2 slds-text-align_right">
              <div className="slds-grid slds-grid_align-spread">
                <div className="slds-col slds-size_1-of-2 slds-p-around_small slds-card">
                  <h4 className="slds-text-heading_small slds-p-around_small" onClick={() => alert("Add new task")}>New Task</h4>
                </div>
                <div className="slds-col slds-size_1-of-2 slds-p-around_small slds-card">
                  <h4 className="slds-text-heading_small slds-p-around_small" onClick={handleRefresh}>Refresh</h4>
                </div>
              </div>
              <div className="slds-col slds-size_1-of-1 slds-m-top_small">
                <input
                  type="text"
                  className="slds-input"
                  placeholder="Search"
                  value={searchTerm}
                  onChange={handleSearchChange}
                />
              </div>
            </div>
          </div>
        </div>
        <table className="slds-table slds-table_bordered slds-table_cell-buffer">
          <thead>
            <tr className="slds-text-title_caps">
              <th>
                <input type="checkbox" />
              </th>
              <th scope="col">Assigned To</th>
              <th scope="col">Status</th>
              <th scope="col">Due Date</th>
              <th scope="col">Priority</th>
              <th scope="col">Comments</th>
              <th scope="col">Actions</th>
            </tr>
          </thead>
          <tbody>
            {tasks.map((task) => (
              <tr key={task._id}>
                <td>
                  <input type="checkbox" />
                </td>
                <td>{task.AssignedTo}</td>
                <td>{task.Status}</td>
                <td>{new Date(task.DueDate).toLocaleDateString()}</td>
                <td>{task.Priority}</td>
                <td>{task.Comments}</td>
                <td>
                  <button className="slds-button slds-button_outline slds-button_brand slds-m-right_small">
                    Edit
                  </button>
                  <button className="slds-button slds-button_outline slds-button_destructive">Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Tasks;
